    const { questionsData } = useContext(QuestionsContext);
    console.log("questionsData title ", questionsData);

    const [questionOpen, setQuestionOpen] = useState("");

    return (
        <section className='second-section-wrapper'>
            <h2>Preguntas frecuentes</h2>
            {questionsData && (
                questionsData.data.map((item: { title: string; description: string; id: number; }) => (
                <Collapsible 
                    className='collapsible' 
                    trigger={<p>{item.title}</p>}
                    onOpening={() => console.log(item.id)}
                >
                    <p>{item.description}</p>
                </Collapsible>
                ))
                )}

        </section>
    );
}



